INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('8711000533925', 'Jacques Vabre Café soluble Gringo le bocal de 200 g', 'Depuis toujours, Jacques Vabre est passionné de café, ce produit de caractère, presque vivant tant il est animé d\'arômes, d\'évocations... Grâce à son talent et à son expertise, Jacques Vabre crée des cafés aux goûts variés qui vont mettre vos sens en éveil. En mariant avec soin des grains de grande qualité, Jacques Vabre a conçu un café vraiment équilibré : un café bien afirmé, intense sans être corsé, avec ce qu\'il faut d\'amertume mais sans âpreté. Un café fin tout en étant marqué. Conseils de préparation Lorsque le torréfacteur réalise un mélange, il assemble les meilleurs grains, déguste de nombreux cafés pour parvenir à force de padence et d\'imagination au mariage le plus harmonieux possible. Pour retrouver tout cet arôme et cette saveur, versez une cuillère à café dans votre tasse, puis ajouter de l\'eau frémissante mais non bouillante.', '', '0', '0', '0', '0', '', '0', '0', '0', '', '1');

