VALUES ('8711200527489', 'Coffret Infusion Bien-Être', 'Nuit tranquille : Tilleul (35,3%), verveine, lavande, arôme (10,3%), camomille (5,9%), feuilles d\'oranger (5,9%), mélisse. Digestion légère : Menthe (30,9%), verveine (18,2%), camomille, mélisse (12,1 %%), réglisse (9%), rooibos, arôme (5,6%), écorces de citron. Ligne & équilibre : églantier (59,7%), feuilles d\'oranger, citronnelle (7,7%), écorces d\'orange, hibiscus, arôme (2,7%), fleurs de sureau (1%). Relaxation & anti-stress : Tilleul, feuilles d\'oranger (24%), lavande, camomille (19,2%), arôme (3,4%), gousses de vanille (0,6%). Un zeste de peps : Menthe (37%), citronnelle, écorces de citron (14%), verveine, arôme (4,4%), acidifiant : acide citrique, chicorée. Élimination et bien être : Queues de cerise (35,5%), hibiscus, pomme, feuilles d\'oranger, arôme (9,1%), feuilles de frêne, baies de cassis (1,8%), reine des prés (1,8%).', 'https://static.openfoodfacts.org/images/products/871/120/052/7489/front.10.400.jpg', '0', '0', '0.5', '0.5', '', '0.5', '0', '0', '', '1');

